        <div className="item" key={id}>
            {name}
            <br/>
            <img alt="https://randomuser.me/api/portraits/lego/2.jpg" src={`https://randomuser.me/api/portraits/lego/${id}.jpg`} />
        </div>
    )
}

export default Card;
